script: |
  super -f text -I q8612.spq | sort > q8612.out

inputs:
  - name: q8612.spq
    data: |
      SELECT + ( + 53 ) + cor1.col1 + cor1.col0 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab2

outputs:
  - name: q8612.out
    data: |
      163
      163
      163
      185
      185
      185
      233
      233
      233
